def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    parts = input1.split('-')
    result = []
    for i, part in enumerate(parts):
        if i > 0:
            result.append(part.capitalize())
        else:
            result.append(part)
    return ''.join(result)
